export default class iconList extends React.PureComponent {
  render(){
    return(
      <DataContext.Consumer>
       {({lng}) =>{
        const colors = KEYS[lng].iconColors;
        return Object.keys(colors).map((key,i)=><Row key={i}>
            <SVGEC><SSVG>{svgFile(colors[key])}</SSVG></SVGEC>
            <Description><DataHover value={key} placement="right"/></Description>
          </Row>);
       }} 
      </DataContext.Consumer>
      );
  }
}
